DROP TABLE IF EXISTS `es_group`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `es_group` (
  `group_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '群ID',
  `leader_id` int(11) DEFAULT NULL COMMENT '群主ID',
  `group_name` varchar(100) DEFAULT NULL COMMENT '群名字',
  `description` varchar(150) DEFAULT NULL COMMENT '群介绍',
  `category_id` int(11) DEFAULT NULL COMMENT '所属最小一级分类ID',
  `create_id` int(11) DEFAULT NULL COMMENT '创建人ID',
  `create_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `update_time` int(11) DEFAULT NULL COMMENT '修改时间（名字，资料）',
  `delete_status` tinyint(1) DEFAULT NULL COMMENT '删除状态（-1：删除；1：正常）',
  `delete_time` int(11) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`group_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='群表';
