CREATE TABLE `es_group_member` (
  `group_member_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '群成员ID',
  `group_id` int(11) DEFAULT NULL COMMENT '群ID',
  `member_id` int(11) DEFAULT NULL COMMENT '成员ID',
  `member_nick_name` varchar(50) DEFAULT NULL COMMENT '用户加群时的昵称',
  `group_nick_name` varchar(50) DEFAULT NULL COMMENT '群名片-名字备注-马甲',
  `role_id` int(11) DEFAULT NULL COMMENT '用户群角色ID',
  `role_type` varchar(50) DEFAULT NULL COMMENT '用户群角色类型名称',
  `join_time` int(11) DEFAULT NULL COMMENT '入群时间',
  `join_note` varchar(200) DEFAULT NULL COMMENT '加群说明',
  `out_time` int(11) DEFAULT NULL COMMENT '退群时间',
  `agree_id` int(11) DEFAULT NULL COMMENT '同意进群的管理员ID',
  `agree_time` int(11) DEFAULT NULL COMMENT '管理员同意时间',
  `delete_id` int(11) DEFAULT NULL COMMENT '删除人ID',
  `delete_time` int(11) DEFAULT NULL COMMENT '被删除时间',
  `black_list_id` int(11) DEFAULT NULL COMMENT '操作拉黑人ID',
  `black_list_time` int(11) DEFAULT NULL COMMENT '被管理员拉黑时间',
  `is_reported` tinyint(1) DEFAULT '1' COMMENT '被举报时间',
  `being_reported_time` int(11) DEFAULT NULL COMMENT '被举报时间',
